"use strict";

const { Counter } = require('collections');

function buddyStrings(s, goal) {
    const m = s.length, n = goal.length;
    if (m !== n) {
        return false;
    }
    const diff = goal.split('').reduce((acc, cur, i) => acc + (cur !== s[i] ? 1 : 0), 0);
    const cnt1 = Counter(s), cnt2 = Counter(goal);
    if (JSON.stringify(cnt1) !== JSON.stringify(cnt2)) {
        return false;
    }
    return diff === 2 || (diff === 0 && Object.values(cnt1).some(e => e > 1));
}

const s = "...", goal = "...";
console.log(buddyStrings(s, goal));
